import { postData } from "./utils.js";
const container = document.getElementById("crypto-container");

async function deleteCrypto(crypto, el) {
    const response = await postData("api/crypto/", {crypto}, "DELETE");
    if(response.success) {
        el.offsetParent.remove();
    }
}

const generateCard = (data) => {
    const el = document.createElement("div");
    el.classList.add("col-xl-6", "col-lg-6");
    const html = `
    <div class="card card-stats mb-4" style="border-radius: 30px">
        <div class="card-body">
            <div class="row">
            <div class="col">
                <h5 class="card-title text-uppercase text-muted mb-0">${data.name}</h5>
                <span class="h2 font-weight-bold mb-0">${Math.trunc(data.priceUsd * 100) / 100}$</span>
            </div>
            <div class="col-auto">
                <i onclick="" class="fas fa-times delete-icon"></i>
            </div>
            </div>
            <p class="mt-3 mb-0 text-muted text-sm">
            <span class="text-${data.changePercent24Hr > 0 ? "success" : "danger"} mr-2"><i class="fa fa-arrow-${data.changePercent24Hr > 0 ? "up" : "down"}"></i>
                ${Math.trunc(data.changePercent24Hr * 100) / 100}%</span>
            <span class="text-nowrap">Past 24 hours</span>
            </p>
        </div>
    </div>
    `;
    el.innerHTML = html;
    el.getElementsByClassName("delete-icon")[0].addEventListener('click', (e) => {
        deleteCrypto(data.id, e.target);
    });

    return el;
};

const render = async () => {
    fetch("/api/crypto").then(res => res.json()).then(result => {
        if (result.name == "Error") {
            return Swal.fire(result.message, "Please try again later", "error");
        }
        const cryptos = result.data;
        cryptos.forEach(crypto => {
            const card = generateCard(crypto);
            container.appendChild(card);
        });
    });
};

render();

const trackNewCrypto = async (cryptos) => {
    const response = await postData(`/api/crypto/`, { crypto: cryptos }, "PUT");

    return response;
};


